export default function Post({ title, content, author,dateCreated, complete, dateComleted }) {
  return (

    <div style={{border: '1px solid rgba(127, 0, 0, 0.4)', 

}}>
      <h2 style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}}>{title}</h2>
      <h8 style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(70, 100, 255, 0.7)'}}><br /><i>  Written by <b>{author}</b></i></h8>
      <div style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(0, 0, 0, 1)',border: '2px solid rgba(0, 0, 0, 0.4)'}}>{content}</div>
      <h8 style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(0, 100, 0, 0.7)'}} >    Created: {dateCreated}</h8>
      <div style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}} >
      <input type="checkbox" />
    </div>
	  <h9 style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}} >    Completed:  {dateComleted}</h9>
    <br> </br>
    </div>
  );
}
